class SidebarComponent extends Component {
    render(){
        return(
            <div>
                <nav class="nav flex-column">
                    <a class="nav-link active" aria-current="page" href="#">Dashboard</a>
                    <a class="nav-link" href="#">Catalog</a>
                </nav>
            </div>
        );
    }
}

export default SidebarComponent;
